window.bookSummaryJSON = "<p><b><i>She’s America’s It girl. He’s Britain’s most eligible bachelor.</i></b></p> <p><b><i>First impressions are supposed to last…but they’re losing track.</i></b><br> <br> Summer in the Hamptons is predictable. Lavish parties. Polo matches. Private yachts.<br> <br> So the surprise arrival of Charlie Marlborough causes an excited stir throughout the higher echelons of society. The upper crust he’s come to impress. Wealthy elites he <i>has </i>to impress, or risk losing everything.<br> <br> Billionaire heiress Lili Kensington isn’t dazzled by Britain’s youngest duke. In fact, she’s not awed by him at all. She resolves to stay far away from New York’s newest deity, but that proves to be a harder task than she anticipated.<br> <br> The only daughter and eldest child of American royalty, Lili is well acquainted with unwavering attention. She’s used to fake flattery and whispers about her family’s immense wealth. Accustomed to men trying to cajole their way into her bed and her bank account. Yet Charlie’s disregard for the obvious aspects of her identity only makes her more confused about his true character.<br> <br> Each time their privileged worlds collide, Lili’s and Charlie’s perceptions of each other shift. They put on acts in public, but stop performing when they’re alone. Motivations become murky. Attraction develops into intimacy. Lust starts to look a lot like love.<br> <br> She swore she’d never fall for a false god.<br> <br> He never intended to fall at all.<br> <br> Even patricians can’t lay perfect plans....</p>"; 
